      width:100%;
      height:100px;
      position:absolute;
      left:0px;
      background: linear-gradient(to left bottom, #f8f8f8 49%, #f8f8f8 50%);
    }

  `;

  return (
    <Homewrapper>
      <div className='skew-c'></div>
      <Container>
